    true,nt"url": null,nt"notes": "Global Navigation Satellite System (GNSS)
    data consists of the U.S. Global Positioning System (GPS) and the Russian GLObal
    NAvigation Satellite System (GLONASS) (plus other international systems) data sets.
    The Global Positioning System, developed by the U.S. Department of Defense, has
    been fully operational since 1994. GPS consists of a constellation of 24 satellites
    and three active spares each traveling in a 12 hour circular orbit, 20,200 kilometers
    above the Earth. The satellites are positioned so that six are observable nearly
    100 percent of the time from any point on the Earth. The GLObal NAvigation Satellite
